// src/components/js/SelectedTrains.jsx
import React from 'react';

const SelectedTrains = ({ selectedTrains }) => {
  if (!selectedTrains.length) {
    return <p>선택된 열차가 없습니다.</p>;
  }

  return (
    <div>
      <h2>선택된 열차</h2>
      <ul>
        {selectedTrains.map((train) => (
          <li key={train.uniqueId}>
            <p>{train.traingradename} / 출발: {train.depplacename}역 / 도착: {train.arrplacename}역 / 열차번호: {train.trainno}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SelectedTrains;
